import React, { useState } from 'react';

function Login() {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [userType, setUserType] = useState('government');

  const handleLogin = () => {
    // Implement login logic here
  };

  const handleSignup = () => {
    // Implement signup logic here
  };

  return (
    <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center', height: '100vh' }}>
      <h2>Login</h2>
      <input
        type="text"
        placeholder="Username"
        value={username}
        onChange={(e) => setUsername(e.target.value)}
        style={{ marginBottom: '10px' }}
      />
      <input
        type="password"
        placeholder="Password"
        value={password}
        onChange={(e) => setPassword(e.target.value)}
        style={{ marginBottom: '10px' }}
      />
      <div>
        <input
          type="radio"
          id="government"
          name="userType"
          value="government"
          checked={userType === 'government'}
          onChange={() => setUserType('government')}
        />
        <label htmlFor="government" style={{ marginRight: '10px' }}>Government</label>

        <input
          type="radio"
          id="researchers"
          name="userType"
          value="researchers"
          checked={userType === 'researchers'}
          onChange={() => setUserType('researchers')}
        />
        <label htmlFor="researchers">Researchers</label>
      </div>
      <button onClick={handleLogin} style={{ marginTop: '10px', marginRight: '5px' }}>Login</button>
      <button onClick={handleSignup} style={{ marginTop: '10px' }}>Signup</button>
    </div>
  );
}

export default Login;
